import './App.css';

import Books from './Pages/Books';
import Author from './Pages/Author';
import Publisher from './Pages/Publisher';
import Availability from './Pages/Availability';
import Ledger from './Pages/Ledger';

import {Route,Routes,BrowserRouter} from "react-router-dom";
//import Form from './Pages/Form';


function App() {
  return (
    <div>
    <BrowserRouter>
    <Routes>
      <Route path='/' exact element = {<Books/>}></Route>
      <Route path='/Author' exact element = {<Author/>}></Route>
      <Route path='/Availability' exact element = {<Availability/>}></Route>
      <Route path='/Publisher' exact element = {<Publisher/>}></Route>
      <Route path='/Ledger' exact element = {<Ledger/>}></Route>
      {/* <Route path='/Form' exact element = {<Form/>}></Route> */}
    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
